import * as React from "react";
import { styled } from "@mui/material/styles";

import Table from "@mui/material/Table";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";

import Divider from "@mui/material/Divider";

import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";

import Button from "@mui/material/Button";
import Accordion from "@mui/material/Accordion";
import AccordionSummary from "@mui/material/AccordionSummary";
import AccordionDetails from "@mui/material/AccordionDetails";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import NavigateNextRoundedIcon from "@mui/icons-material/NavigateNextRounded";
import Image from "mui-image";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function createData(handWash, exterior, interior, deluxe) {
  return { handWash, exterior, interior, deluxe };
}

const rows = [createData("$15", "$30", "$35", "$130")];

export default function BasicTable() {
  return (
    <Box sx={{ flexGrow: 1 }}>
    <Grid
      container
      spacing={2}
      direction="row"
      justifyContent="center"
      alignItems="center"
    >
      {/*//=========== GRID BOX START =================================> */}
      <Grid item xs={11} md={3.5}>
        <Item sx={{ bgcolor: "primary.main", color: "white" }}>
          <Image src={require("../images/headlight.webp")} />
          {/* =============== === ACCORDIAN START === ===================*/}
          <Accordion
            sx={{ bgcolor: "primary.dark", color: "primary.contrastText" }}
          >
            <AccordionSummary
              expandIcon={
                <ExpandMoreIcon sx={{ color: "primary.contrastText" }} />
              }
              aria-controls="panel1a-content"
              id="panel1a-header"
            >
              <Typography>Detailing Prices</Typography>
            </AccordionSummary>
            <AccordionDetails
              sx={{
                bgcolor: "secondary.main",
                color: "primary.contrastText",
              }}
            >
              <Typography>
                This is a battleship game I created using HTML, CSS, and
                JavaScript. Contains a custom AI to make it more
                challenging.
              </Typography>
              <br />
              <Button
                href="https://jeremyduncan.github.io/Battleship/"
                target="_blank"
                rel="noopener"
                variant="contained"
                endIcon={<NavigateNextRoundedIcon />}
              >
                Visit
              </Button>
            </AccordionDetails>
          </Accordion>
          {/* =============== === ACCORDIAN END === =====================*/}
        </Item>
      </Grid>
      {/*//=========== GRID END =======================================> */}
      </Grid>


      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Car
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
      <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Regular Cab Truck
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
