                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Van
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Small SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Mid-Size SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
            Full-Size SUV
          </Typography>
        </Divider>
        <Table
          sx={
            {
              /*INSERT CSS  */
            }
          }
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell align="center">Hand Wash</TableCell>
              <TableCell align="center">Interior</TableCell>
              <TableCell align="center">Exterior</TableCell>
              <TableCell align="center">Deluxe**</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                bgColor="main.light"
                key={row.name}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{row.handWash}</TableCell>
                <TableCell align="center">{row.exterior}</TableCell>
                <TableCell align="center">{row.interior}</TableCell>
                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Divider></Divider>
    </Box>
  );
}
